import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import PropTypes from "prop-types";
import { Card, Grid, Divider, Container, Box, Button } from "@mui/material";
import Icon from "@mui/material/Icon";

// Components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";
import MDButton from "components/MDButton";
import TrimaIcon from "components/CustomIcons/Trima";
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";

// Estilos para impressÃ£o
const printStyles = `
  @media print {
    @page {
      size: auto;
      margin: 15px;
    }

    body * {
      visibility: hidden;
      margin-top:-30px;
    }

    #report-content, #report-content * {
      visibility: visible;
    }

    #report-content {
      position: absolute;
      left: 0;
      top: 0;
      width: 95%;
      padding: 20px;
      margin: 0 auto;
    }

    /* MantÃ©m o layout em grid */
    .MuiGrid-container {
      display: flex !important;
      flex-wrap: wrap !important;
    }

    /* MantÃ©m as proporÃ§Ãµes originais dos itens do grid */
    .MuiGrid-item {
      flex-basis: 25% !important;
      max-width: 25% !important;
      padding: 8px !important;
    }

    /* Ajusta containers principais */
    .MuiContainer-root {
      max-width: 100% !important;
      padding: 0 !important;
    }

    .MuiCard-root {
      box-shadow: none !important;
      width: 100% !important;
    }

    /* Remove elementos desnecessÃ¡rios */
    .no-print {
      display: none !important;
    }

    /* Ajusta espaÃ§amentos internos */
    .MuiBox-root {
      margin: 0 !important;
    }
  }
`;

const ReportSection = ({ title, children }) => (
  <Box mb={3}>
    <MDTypography variant="h6" fontWeight="medium" mb={1}>
      {title}
    </MDTypography>
    <Box ml={2}>{children}</Box>
  </Box>
);

ReportSection.propTypes = {
  title: PropTypes.string.isRequired,
  children: PropTypes.node.isRequired,
};

const ReportField = ({ label, value }) => (
  <Grid item xs={6} sm={4} md={3}>
    <Box display="flex" flexDirection="column" mb={2}>
      <MDTypography variant="caption" color="text" fontWeight="bold">
        {label}
      </MDTypography>
      <MDTypography variant="body2">{value || "---"}</MDTypography>
    </Box>
  </Grid>
);

ReportField.propTypes = {
  label: PropTypes.string.isRequired,
  value: PropTypes.oneOfType([PropTypes.string, PropTypes.number, PropTypes.node]),
};

ReportField.defaultProps = {
  value: "---",
};

function TrimaReport() {
  const { codigo } = useParams(); // Este Ã© o CodigoDoacao
  const [reportData, setReportData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const getTypeIcon = (type) => {
    switch (type.toLowerCase()) {
      // Alertas
      case "alert":
      case "alerta":
        return "âš ï¸";

      case "alarm":
      case "alarme":
      case "alarma":
        return "ðŸš¨";

      case "adjustment":
      case "ajuste":
        return "ðŸ› ï¸";

      default:
        return "";
    }
  };

  useEffect(() => {
    const style = document.createElement("style");
    style.innerHTML = printStyles;
    document.head.appendChild(style);

    return () => {
      document.head.removeChild(style);
    };
  }, []);

  // FunÃ§Ã£o para converter milissegundos para hh:mm:ss apÃ³s divisÃ£o por 10.000
  const formatDuration = (milliseconds) => {
    // Dividir por 10.000
    const adjustedSeconds = milliseconds / 10000000;

    // Calcular horas, minutos e segundos
    const hours = Math.floor(adjustedSeconds / 3600);
    const minutes = Math.floor((adjustedSeconds % 3600) / 60);

    // Formatar com duas casas
    const formattedHours = String(hours).padStart(2, "0");
    const formattedMinutes = String(minutes).padStart(2, "0");

    return `${formattedHours}:${formattedMinutes}`;
  };

  const formatDurationHHMM = (duration) => duration?.substring(0, 5) || "---";

  useEffect(() => {
    const fetchReportData = async () => {
      try {
        setLoading(true);
        const token = localStorage.getItem("authToken");

        // Primeiro, buscar o SessionID correspondente ao CodigoDoacao
        const proceduresResponse = await fetch(
          `${process.env.REACT_APP_API_URL}/api/apheresisProcedures`,
          {
            headers: {
              Authorization: `Bearer ${token}`,
            },
          }
        );

        if (!proceduresResponse.ok) {
          throw new Error(`HTTP error! status: ${proceduresResponse.status}`);
        }

        const proceduresData = await proceduresResponse.json();
        const procedure = proceduresData.find((proc) => proc.CodigoDoacao === codigo);

        if (!procedure) {
          throw new Error("Procedimento nÃ£o encontrado");
        }

        const sessionId = procedure.SessinID; // Usando o SessionID encontrado

        // Agora, buscar os dados do relatÃ³rio usando o SessionID
        const reportResponse = await fetch(
          `${process.env.REACT_APP_API_URL}/api/trimaReport/${sessionId}`,
          {
            headers: {
              Authorization: `Bearer ${token}`,
            },
          }
        );

        if (!reportResponse.ok) {
          if (reportResponse.status === 404) {
            throw new Error("RelatÃ³rio nÃ£o encontrado");
          }
          throw new Error(`HTTP error! status: ${reportResponse.status}`);
        }

        const data = await reportResponse.json();
        setReportData(data);
        setError(null);
      } catch (error) {
        console.error("Erro ao buscar dados do relatÃ³rio:", error);
        setError("Erro ao carregar os dados do relatÃ³rio");
      } finally {
        setLoading(false);
      }
    };

    fetchReportData();
  }, [codigo]);

  const handlePrint = () => {
    window.print();
  };

  return (
    <DashboardLayout>
      <DashboardNavbar />
      <Container maxWidth="lg" sx={{ py: 4 }}>
        <Card>
          <MDBox p={3}>
            {loading && (
              <MDTypography variant="h6" textAlign="center">
                Carregando...
              </MDTypography>
            )}

            {error && (
              <MDTypography variant="h6" color="error" textAlign="center">
                {error}
              </MDTypography>
            )}

            {!loading && !error && reportData && (
              <>
                <Box display="flex" justifyContent="flex-end" mb={2} className="no-print">
                  <MDButton
                    variant="gradient"
                    color="info"
                    onClick={handlePrint}
                    startIcon={<Icon>print</Icon>}
                  >
                    Imprimir RelatÃ³rio
                  </MDButton>
                </Box>

                <Box id="report-content">
                  {/* CabeÃ§alho */}
                  <Box display="flex" alignItems="center" mb={3}>
                    <TrimaIcon sx={{ fontSize: 40, mr: 2 }} />
                    <Box>
                      <MDTypography variant="h4">
                        RelatÃ³rio de Procedimento Trima - {codigo}
                      </MDTypography>
                    </Box>
                  </Box>

                  <Divider sx={{ my: 3 }} />

                  <ReportSection title="InformaÃ§Ãµes do Doador">
                    <Grid container spacing={2}>
                      <ReportField label="Nome" value={reportData.DonorName} />
                      <ReportField label="Data de Nascimento" value={reportData.DOB} />
                      <ReportField label="Sexo" value={reportData.DonorGender} />
                      <ReportField
                        label="Peso"
                        value={
                          reportData.DonorWeight
                            ? `${reportData.DonorWeight} ${reportData.DonorWeightUnit}`
                            : "---"
                        }
                      />
                      <ReportField
                        label="Altura"
                        value={
                          reportData.DonorHeight
                            ? `${reportData.DonorHeight} ${reportData.DonorHeightUnit}`
                            : "---"
                        }
                      />
                      <ReportField
                        label="HematÃ³crito"
                        value={
                          reportData.DonorHematocrit ? `${reportData.DonorHematocrit}%` : "---"
                        }
                      />
                      <ReportField
                        label="Plaquetas PrÃ©"
                        value={
                          reportData.DonorPreCount ? `${reportData.DonorPreCount} x10Â³/mL` : "---"
                        }
                      />
                      <ReportField label="Tipo SanguÃ­neo" value={reportData.DonorBloodType} />
                    </Grid>
                  </ReportSection>

                  {/* Dados do Procedimento */}
                  <ReportSection title="Dados do Procedimento">
                    <Grid container spacing={2}>
                      <ReportField
                        label="Data"
                        value={
                          reportData.ProcedureDate
                            ? new Date(reportData.ProcedureDate).toLocaleDateString("pt-BR", {
                                day: "2-digit",
                                month: "2-digit",
                                year: "numeric",
                              })
                            : "---"
                        }
                      />
                      <ReportField
                        label="InÃ­cio ExtraÃ§Ã£o"
                        value={
                          reportData.ProcedureDate
                            ? new Date(reportData.ProcedureDate).toLocaleTimeString("pt-BR", {
                                hour: "2-digit",
                                minute: "2-digit",
                              })
                            : "---"
                        }
                      />
                      <ReportField
                        label="DuraÃ§Ã£o"
                        value={formatDuration(reportData.DurationOfRun)}
                      />
                      <ReportField
                        label="Volume Processado"
                        value={reportData.VbpTotal ? `${reportData.VbpTotal} mL` : "---"}
                      />
                      <ReportField label="NÃºmero de SÃ©rie" value={reportData.SerialNumber} />
                      <ReportField
                        label="IdentificaÃ§Ã£o do Dispositivo"
                        value={reportData.DeviceShortName}
                      />
                      <ReportField label="DescartÃ¡vel" value={reportData.CassetteTypeRefId} />
                      <ReportField
                        label="HematÃ³crito PÃ³s"
                        value={
                          reportData.DonorPostHematocrit
                            ? `${reportData.DonorPostHematocrit}%`
                            : "---"
                        }
                      />
                      <ReportField
                        label="Plaquetas PÃ³s"
                        value={
                          reportData.DonorPostCount ? `${reportData.DonorPostCount} x10Â³/mL` : "---"
                        }
                      />
                    </Grid>
                  </ReportSection>

                  {/* Concentrado de Plaquetas - sÃ³ exibe se Yield > 0 */}
                  {reportData.Yield > 0 && (
                    <ReportSection title="Concentrado de Plaquetas">
                      <Grid container spacing={2}>
                        <ReportField
                          label="Rendimento Coletado"
                          value={`${reportData.Yield} x 10Â¹Â¹`}
                        />
                        <ReportField label="Volume Coletado" value={`${reportData.BagVolume} mL`} />
                      </Grid>
                    </ReportSection>
                  )}

                  {/* Plasma - sÃ³ exibe se BagVolumePlasma > 0 */}
                  {reportData.BagVolumePlasma > 0 && (
                    <ReportSection title="Plasma">
                      <Grid container spacing={2}>
                        <ReportField
                          label="Volume Coletado"
                          value={`${reportData.BagVolumePlasma} mL`}
                        />
                      </Grid>
                    </ReportSection>
                  )}

                  {/* Concentrados de HemÃ¡cias - sÃ³ exibe se alguma bolsa tem volume > 0 */}
                  {(reportData.BagVolumeRBC1 > 0 || reportData.BagVolumeRBC2 > 0) && (
                    <ReportSection title="Concentrados de HemÃ¡cias">
                      <Grid container spacing={2}>
                        {reportData.BagVolumeRBC1 > 0 && (
                          <ReportField
                            label="Volume Bolsa 1"
                            value={`${reportData.BagVolumeRBC1} mL`}
                          />
                        )}
                        {reportData.BagVolumeRBC2 > 0 && (
                          <ReportField
                            label="Volume Bolsa 2"
                            value={`${reportData.BagVolumeRBC2} mL`}
                          />
                        )}
                      </Grid>
                    </ReportSection>
                  )}

                  {/* SeleÃ§Ãµes de Procedimento */}
                  <ReportSection title="SeleÃ§Ãµes de Procedimento">
                    {reportData.ExtendedInfoProcedureSelections ? (
                      (() => {
                        const selections = JSON.parse(reportData.ExtendedInfoProcedureSelections);
                        return selections.length > 0 ? (
                          <>
                            {/* CabeÃ§alho das colunas */}
                            <Grid container spacing={2} sx={{ mb: 2, fontWeight: "bold" }}>
                              <Grid item xs={1}>
                                <MDTypography variant="body2" fontWeight="bold">
                                  Hora
                                </MDTypography>
                              </Grid>
                              <Grid item xs={3}>
                                <MDTypography variant="body2" fontWeight="bold">
                                  Plaquetas
                                </MDTypography>
                              </Grid>
                              <Grid item xs={2}>
                                <MDTypography variant="body2" fontWeight="bold">
                                  HemÃ¡cias
                                </MDTypography>
                              </Grid>
                              <Grid item xs={2}>
                                <MDTypography variant="body2" fontWeight="bold">
                                  Plasma
                                </MDTypography>
                              </Grid>
                              <Grid item xs={2}>
                                <MDTypography variant="body2" fontWeight="bold">
                                  DuraÃ§Ã£o
                                </MDTypography>
                              </Grid>
                              <Grid item xs={2}>
                                <MDTypography variant="body2" fontWeight="bold">
                                  Tipo
                                </MDTypography>
                              </Grid>
                            </Grid>

                            {selections.map((selection, index) => (
                              <Grid container key={index} spacing={2} sx={{ mb: 1 }}>
                                <Grid item xs={1}>
                                  <MDTypography variant="body2">
                                    {new Date(selection.Timestamp).toLocaleTimeString("pt-BR", {
                                      hour: "2-digit",
                                      minute: "2-digit",
                                    })}
                                  </MDTypography>
                                </Grid>
                                <Grid item xs={3}>
                                  <MDTypography variant="body2">
                                    {`${Number(selection.PlateletYield).toFixed(1)}x10Â¹Â¹ / ${
                                      selection.PlateletVolume
                                    }mL`}
                                  </MDTypography>
                                </Grid>
                                <Grid item xs={2}>
                                  <MDTypography variant="body2">
                                    {selection.RBC > 0 ? `${selection.RBC}mL` : "---"}
                                  </MDTypography>
                                </Grid>
                                <Grid item xs={2}>
                                  <MDTypography variant="body2">
                                    {selection.Plasma > 0 ? `${selection.Plasma}mL` : "---"}
                                  </MDTypography>
